const LOGIN_TO_APP_ROUTES = [
    '/auth/login',
    '/auth/register',
    '/auth/invite-user-confirm',
    '/auth/reset-password',
    '/auth/reset-password-confirm',
]

const APP_CONSTANTS = {
    LOGIN_TO_APP_ROUTES,
}

export default APP_CONSTANTS;
